import React from 'react';


const Profile = ({ users }) => {

  const list = users.length ? (
    users.map(user => {
      return (
        <div key={user.id}>
          <p>{user.name}</p>
          <p>{user.surname}</p>
          <p>{user.gender}</p>
          <p>{user.region}</p>
        </div>
      )
    })) : (<p> there is no user.... </p>)
  return (
    <div>
      {list}
    </div>
  )
}



export default Profile;
